  null,\n\t\"notes\": \"Downloaded 10/22/07 from http://www.bts.gov/publications/national_transportation_atlas_database/2007/.
  Queryed out ND via attributes and reprojected in ArcMap. Brian Bieber - NDDOT The
  Airports database is a geographic point database of aircraft landing facilities
  in the United States and U.S. Territories. Attribute data is provided on the physical
  and operational characteristics of the landing facility, current usage including
  enplanements and aircraft operations, congestion levels and usage categories. There
  are 20490 airport landing facilities in this dataset. This geospatial data is derived
  from the FAA's National Airspace System Resource Aeronautical Data Product (Effective
  18 Jaunary 2007).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
